import ExpenseItem from "./ExpenseItem";

const ExpensesList = (props) => {
  // only items that have the same year as the filteredYear will be stored in the
  // filteredExpenseList
  const filterdExpenseList = props.item.filter((expense) => {
    return expense.date.getFullYear().toString() === props.item;
  });
  let expenseContent = <p>No expense(s) found.</p>;

  if (props.items.length > 0) {
    expenseContent = props.items.map((expense) => (
      <ExpenseItem
        key={expense.id}
        title={expense.title}
        amount={expense.amount}
        date={expense.date}
      ></ExpenseItem>
    ));
  }
};

export default ExpnsesList;
